import react, {useEffect, useState} from 'react';

export default function App() {

  function getFlower() {
    fetch('/flower')
      .then(response => response.json())
      .then(data => {
        this.setState({
          flower: data
        });
      });
  }

  return (
    <div className="App">
        {
          getFlower()
        }
    </div>
  );
}
